webpackJsonp([107],{651:function(n,e){n.exports="# image-placeholder.js\n\n`{ ImagePlaceholder }`\n\n## ImagePlaceholder\n\n图片加载占位容器，用以指示图片的加载情况。如果加载失败，用户可以手动点击容器，进行重新加载。实际上，只要子节点支持 `onLoad` 和 `onError`，ImagePlaceholder 就能进行加载指示。\n\n### API\n\n| props | 说明 | 类型 | 默认值 | 必需 |\n|:--|:--|:--|:--|:--|\n| children | 图片子节点 | String | spinner.svg | 是 |\n| loadingLabel | 加载中提示 | ReactNode | 指定图标 | |\n| errorLabel | 加载失败提示 | ReactNode | `'加载超时，点击重试'` | |\n"}});